import Link from "next/link";

const Nav = () => (
  <ul style={{flexBasis:'row', display:'flex', justifyContent:'space-around'}}>
    <li>
      <Link href="/">
        <a>Home</a>
      </Link>
    </li>
    <li>
      <Link href="/about">
        <a>About Us</a>
      </Link>
    </li>
  </ul>
);
export {Nav}
